import React from "react";
import { Button, TextField } from '@material-ui/core';

export function Input(props) {
  console.log("input props", props);
  return (
    <div className="form-group">
      <label>{props.name}</label>
      <TextField className="form-control" {...props} fullWidth variant="outlined" label= "THIS IS A TEST" placeholder="PLACE"/>
    </div>
  );
}

export function FormBtn(props) {
  console.log("formbtn props", props);
  return (
    <Button variant="contained" color="primary" {...props} style={{ float: "right", marginBottom: 10 }}>
      {props.children}
    </Button>
  );
}
